import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Container from "@mui/material/Container";
import Card from "@mui/material/Card";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import Header from "components/Header";
import Avatar from "@mui/material/Avatar";
import Chip from "@mui/material/Chip";

function Dashboard() {
  const navigate = useNavigate();
  const [players, setPlayers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const authToken = localStorage.getItem("authToken");
    if (!authToken) {
      navigate("/auth");
      return;
    }

    const fetchPlayers = async () => {
      try {
        const response = await fetch(
          "https://x8ki-letl-twmt.n7.xano.io/api:TF3YOouP/kbfoundation_players",
          {
            headers: {
              Authorization: `Bearer ${authToken}`,
            },
          }
        );

        if (!response.ok) {
          throw new Error("Failed to fetch players data");
        }

        const data = await response.json();
        setPlayers(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchPlayers();
  }, [navigate]);

  const getStatusColor = (paymentReference) => {
    if (paymentReference) return "success";
    return "warning";
  };

  const getInitials = (name) => {
    return name
      .split(" ")
      .map((n) => n[0])
      .join("")
      .toUpperCase();
  };

  return (
    <>
      <Header />
      <MKBox
        minHeight="100vh"
        width="100%"
        sx={{
          backgroundColor: "#f8f9fa",
          paddingTop: "70px",
          paddingBottom: "30px",
        }}
      >
        <Container>
          <MKTypography variant="h3" mb={4}>
            Players Dashboard
          </MKTypography>
          <Card>
            {isLoading ? (
              <MKBox p={3} textAlign="center">
                Loading players data...
              </MKBox>
            ) : error ? (
              <MKBox p={3} textAlign="center" color="error">
                {error}
              </MKBox>
            ) : (
              <TableContainer>
                <Table>
                  <TableBody>
                    {players.map((player) => (
                      <TableRow 
                        key={player.id}
                        sx={{ 
                          '&:hover': { 
                            backgroundColor: 'rgba(0, 0, 0, 0.04)',
                            cursor: 'pointer'
                          },
                          borderBottom: '1px solid #eee'
                        }}
                      >
                        <TableCell>
                          <MKBox display="flex" alignItems="center">
                            <Avatar 
                              sx={{ 
                                bgcolor: 'error.main',
                                width: 40,
                                height: 40,
                                marginRight: 2
                              }}
                            >
                              {getInitials(player.fullName)}
                            </Avatar>
                            <MKBox>
                              <MKTypography variant="subtitle2" fontWeight="medium">
                                {player.fullName}
                              </MKTypography>
                              <MKTypography variant="caption" color="text.secondary">
                                {player.email}
                              </MKTypography>
                            </MKBox>
                          </MKBox>
                        </TableCell>
                        <TableCell>
                          <MKTypography variant="body2">{player.position}</MKTypography>
                        </TableCell>
                        <TableCell>
                          <Chip
                            label={player.paymentReference ? "Paid" : "Pending"}
                            color={getStatusColor(player.paymentReference)}
                            size="small"
                            sx={{
                              borderRadius: '16px',
                              fontSize: '0.75rem',
                              fontWeight: 600
                            }}
                          />
                        </TableCell>
                        <TableCell>
                          <MKTypography variant="body2">
                            {player.Channel}
                            {player.otherChannel && ` - ${player.otherChannel}`}
                          </MKTypography>
                        </TableCell>
                        <TableCell>
                          <MKTypography variant="body2">
                            {new Date(player.created_at).toLocaleDateString()}
                          </MKTypography>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            )}
          </Card>
        </Container>
      </MKBox>
    </>
  );
}

export default Dashboard;
